            <div id="page-container">
               <!-- <button class="btnclr btn btn-default dropdown-toggle  boxes filip-horizontal mobile_para"  onclick="downloadPagesAsPDF()" style="margin-left:52px; margin-top: 20px;" ><span  class="fa fa-download"></span>Download </button>
               <div id="loading" style="display: none; margin-left:52px;">Generating PDF...</div> -->
               <div id="download" style="margin-bottom: 20vh;">
               <div id="pf1" class="pf w0 h0" data-page-no="1">
                  <div class="pc pc1 w0 h0">
                     <img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/>
                     <div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">Form    <span class="ff2 fs1">W-9</span></div>
                     <div class="t m0 x1 h3 y2 ff1 fs0 fc0 sc0 ls0 ws0">(Rev. October 2018)</div>
                     <div class="t m1 x1 h3 y3 ff1 fs0 fc0 sc0 ls0 ws0">Department of the Treasury  </div>
                     <div class="t m1 x1 h3 y4 ff1 fs0 fc0 sc0 ls0 ws0">Internal Revenue Service </div>
                     <div class="t m0 x2 h4 y5 ff3 fs2 fc0 sc0 ls0 ws0">Request for Taxpayer </div>
                     <div class="t m0 x3 h4 y6 ff3 fs2 fc0 sc0 ls0 ws0">Identification Number and Certification</div>
                     <div class="t m0 x4 h5 y7 ff4 fs3 fc0 sc0 ls0 ws0">▶</div>
                     <div class="t m0 x5 h6 y8 ff1 fs4 fc0 sc0 ls0 ws0"> <span class="ff5">Go to <span class="ff6">www.irs.gov/FormW9 </span>for instructions and the latest information.</span></div>
                     <div class="t m0 x6 h7 y9 ff5 fs5 fc0 sc0 ls0 ws0">Give Form to the  </div>
                     <div class="t m0 x6 h7 ya ff5 fs5 fc0 sc0 ls0 ws0">requester. Do not </div>
                     <div class="t m0 x6 h7 yb ff5 fs5 fc0 sc0 ls0 ws0">send to the IRS.</div>
                     <div class="t m2 x7 h8 yc ff5 fs6 fc0 sc0 ls0 ws0">Print or type. </div>
                     <div class="t m2 x8 h9 yd ff1 fs6 fc0 sc0 ls0 ws0">See<span class="ff5"> Specific Instructions </span>on page 3.</div>
                     <div class="t m0 x9 h3 ye ff5 fs0 fc0 sc0 ls0 ws0">1<span class="ff1">  Name (as shown on your income tax return). Name is required on this line; do not leave this line blank.</span></div>
                     <div class="t m0 x9 h3 yf ff5 fs0 fc0 sc0 ls0 ws0">2<span class="ff1">  Business name/disregarded entity name, if different from above</span></div>
                     <div class="t m0 x9 h3 y10 ff5 fs0 fc0 sc0 ls0 ws0">3<span class="ff1">  Check appropriate box for federal tax classification of the person whose name is entered on line 1. Check only </span>one<span class="ff1"> of the </span></div>
                     <div class="t m0 xa h3 y11 ff1 fs0 fc0 sc0 ls0 ws0">following seven boxes. </div>
                     <div class="t m0 xb h3 y12 ff1 fs0 fc0 sc0 ls0 ws0">Individual/sole proprietor or </div>
                     <div class="t m0 xb h3 y13 ff1 fs0 fc0 sc0 ls0 ws0">single-member LLC</div>
                     <div class="t m0 xc h3 y14 ff1 fs0 fc0 sc0 ls0 ws0"> C Corporation<span class="_ _0"> </span>S Corporation<span class="_ _1"> </span>Partnership<span class="_ _2"> </span>Trust/estate</div>
                     <div class="t m0 xb h3 y15 ff1 fs0 fc0 sc0 ls0 ws0">Limited liability company. Enter the tax classification (C=C corporation, S=S corporation,<span class="ff5"> </span>P=Partnership) </div>
                     <div class="t m0 xd ha y16 ff4 fs7 fc0 sc0 ls0 ws0">▶</div>
                     <div class="t m0 xe hb y15 ff5 fs0 fc0 sc0 ls0 ws0"> </div>
                     <div class="t m0 xb h3 y17 ff5 fs0 fc0 sc0 ls0 ws0">Note:<span class="ff1"> Check the appropriate box in the line above for the tax classification of the single-member owner.  Do not check </span></div>
                     <div class="t m0 xb h3 y18 ff1 fs0 fc0 sc0 ls0 ws0">LLC if the LLC is classified as a single-member LLC that is disregarded from the owner unless the owner of the LLC is </div>
                     <div class="t m0 xb h3 y19 ff1 fs0 fc0 sc0 ls0 ws0">another LLC that is <span class="ff5">not </span>disregarded from the owner for U.S. federal tax purposes. Otherwise, a single-member LLC that </div>
                     <div class="t m0 xb h3 y1a ff1 fs0 fc0 sc0 ls0 ws0">is disregarded from the owner should check the appropriate box for the tax classification of its owner.</div>
                     <div class="t m0 xb h3 y1b ff1 fs0 fc0 sc0 ls0 ws0">Other (see instructions) </div>
                     <div class="t m0 xf ha y1c ff4 fs7 fc0 sc0 ls0 ws0">▶</div>
                     <div class="t m0 x10 hc y1b ff1 fs7 fc0 sc0 ls0 ws0"> </div>
                     <div class="t m0 x11 h3 y1d ff5 fs0 fc0 sc0 ls0 ws0">4<span class="ff1">  Exemptions (codes apply only to </span></div>
                     <div class="t m0 x11 h3 y1e ff1 fs0 fc0 sc0 ls0 ws0">certain entities, not individuals; see </div>
                     <div class="t m0 x11 h3 y1f ff1 fs0 fc0 sc0 ls0 ws0">instructions on page 3):</div>
                     <div class="t m3 x11 h3 y20 ff1 fs0 fc0 sc0 ls0 ws0">Exempt payee code (if any)</div>
                     <div class="t m0 x11 h3 y21 ff1 fs0 fc0 sc0 ls0 ws0">Exemption from FATCA reporting</div>
                     <div class="t m0 x12 h3 y22 ff1 fs0 fc0 sc0 ls0 ws0"> code (if any)</div>
                     <div class="t m0 x11 hd y23 ff7 fs7 fc0 sc0 ls0 ws0">(Applies to accounts maintained outside the U.S.)</div>
                     <div class="t m0 x9 h3 y24 ff5 fs0 fc0 sc0 ls0 ws0">5<span class="ff1">  Address (number, street, and apt. or suite no.) See instructions.</span></div>
                     <div class="t m0 x9 h3 y25 ff5 fs0 fc0 sc0 ls0 ws0">6<span class="ff1">  City, state, and ZIP code</span></div>
                     <div class="t m0 x13 h3 y24 ff1 fs0 fc0 sc0 ls0 ws0">Requester’s name and address (optional)</div>
                     <div class="t m0 x14 h3 y26 ff5 fs0 fc0 sc0 ls0 ws0">7<span class="ff1">  List account number(s) here (optional)</span></div>
                     <div class="t m0 x15 he y27 ff5 fs8 fc1 sc0 ls0 ws0">Part I<span class="_ _3"> </span><span class="fc0">Taxpayer Identification Number (TIN)</span></div>
                     <div class="t m0 x1 h6 y28 ff1 fs4 fc0 sc0 ls0 ws0">Enter your TIN in the appropriate box. The TIN provided must match the name given on line 1 to avoid </div>
                     <div class="t m0 x1 h6 y29 ff1 fs4 fc0 sc0 ls0 ws0">backup withholding. For individuals, this is generally your social security number (SSN). However, for a </div>
                     <div class="t m0 x1 h6 y2a ff1 fs4 fc0 sc0 ls0 ws0">resident alien, sole proprietor, or disregarded entity, see the instructions for Part I, later. For other </div>
                     <div class="t m0 x1 h6 y2b ff1 fs4 fc0 sc0 ls0 ws0">entities, it is your employer identification number (EIN). If you do not have a number, see <span class="ff7">How to get a </span></div>
                     <div class="t m0 x1 h6 y2c ff7 fs4 fc0 sc0 ls0 ws0">TIN, <span class="ff1">later.</span></div>
                     <div class="t m0 x1 h6 y2d ff5 fs4 fc0 sc0 ls0 ws0">Note: <span class="ff1">If the account is in more than one name, see the instructions for line 1. Also see <span class="ff7">What Name and </span></span></div>
                     <div class="t m0 x1 h6 y2e ff7 fs4 fc0 sc0 ls0 ws0">Number To Give the Requester <span class="ff1">for guidelines on whose number to enter.</span></div>
                     <div class="t m0 x16 hb y2f ff5 fs0 fc0 sc0 ls0 ws0">Social security number</div>
                     <div class="t m0 x17 hf y2a ff5 fs4 fc0 sc0 ls0 ws0">–<span class="_ _4"> </span>–</div>
                     <div class="t m0 x18 h7 y30 ff5 fs5 fc0 sc0 ls0 ws0">or</div>
                     <div class="t m0 x16 hb y31 ff5 fs0 fc0 sc0 ls0 ws0">Employer identification number<span class="fc2"> </span></div>
                     <div class="t m0 x19 hf y32 ff5 fs4 fc0 sc0 ls0 ws0">–</div>
                     <div class="t m0 x1a he y33 ff5 fs8 fc1 sc0 ls0 ws0">Part II<span class="_ _5"> </span><span class="fc0">Certification</span></div>
                     <div class="t m0 x1 h6 y34 ff1 fs4 fc0 sc0 ls0 ws0">Under penalties of perjury, I certify that:</div>
                     <div class="t m0 x1 h6 y35 ff1 fs4 fc0 sc0 ls0 ws0">1. The number shown on this form is my correct taxpayer identification number (or I am waiting for a number to be issued to me); and</div>
                     <div class="t m0 x1 h6 y36 ff1 fs4 fc0 sc0 ls0 ws0">2. I am not subject to backup withholding because: (a) I am exempt from backup withholding, or (b) I have not been notified by the Internal Revenue </div>
                     <div class="t m0 x1b h6 y37 ff1 fs4 fc0 sc0 ls0 ws0">Service (IRS) that I am subject to backup withholding as a result of a failure to report all interest or dividends, or (c) the IRS has notified me that I am </div>
                     <div class="t m0 x1b h6 y38 ff1 fs4 fc0 sc0 ls0 ws0">no longer subject to backup withholding; and</div>
                     <div class="t m0 x1 h6 y39 ff1 fs4 fc0 sc0 ls0 ws0">3. I am a U.S. citizen or other U.S. person (defined below); and</div>
                     <div class="t m0 x1 h6 y3a ff1 fs4 fc0 sc0 ls0 ws0">4. The FATCA code(s) entered on this form (if any) indicating that I am exempt from FATCA reporting is correct.</div>
                     <div class="t m4 x1 h6 y3b ff5 fs4 fc0 sc0 ls0 ws0">Certification instructions. <span class="ff1">You must cross out item 2 above if you have been notified by the IRS that you are currently subject to backup</span> <span class="ff1">withholding because </span></div>
                     <div class="t m4 x1 h6 y3c ff1 fs4 fc0 sc0 ls0 ws0">you have failed to report all interest and dividends on your tax return. For real estate transactions, item 2 does not apply.<span class="ff5"> </span>For mortgage interest paid, </div>
                     <div class="t m4 x1 h6 y3d ff1 fs4 fc0 sc0 ls0 ws0">acquisition or abandonment of secured property, cancellation of debt, contributions to an individual retirement<span class="ff5"> </span>arrangement (IRA), and generally, payments </div>
                     <div class="t m4 x1 h6 y3e ff1 fs4 fc0 sc0 ls0 ws0">other than interest and dividends, you are not required to sign the certification, but you must<span class="ff5"> </span>provide your correct TIN. See the instructions for Part II, later.</div>
                     <div class="t m0 x1 he y3f ff5 fs8 fc0 sc0 ls0 ws0">Sign </div>
                     <div class="t m0 x1 he y40 ff5 fs8 fc0 sc0 ls0 ws0">Here</div>
                     <div class="t m0 x1c hb y41 ff5 fs0 fc0 sc0 ls0 ws0">Signature of </div>
                     <div class="t m0 x1c h3 y42 ff5 fs0 fc0 sc0 ls0 ws0">U.S. person<span class="ff1"> </span></div>
                     <div class="t m0 x1d ha y43 ff4 fs7 fc0 sc0 ls0 ws0">▶</div>
                     <div class="t m0 x1e hb y42 ff5 fs0 fc0 sc0 ls0 ws0" style="position: inherit;bottom: 348px;">Date </div>
                     <div class="t m0 x1f ha y43 ff4 fs7 fc0 sc0 ls0 ws0">▶</div>
                     <div class="t m0 x1 h10 y44 ff5 fs2 fc0 sc0 ls0 ws0">General Instructions</div>
                     <div class="t m0 x1 h6 y45 ff1 fs4 fc0 sc0 ls0 ws0">Section references are to the Internal Revenue Code unless otherwise </div>
                     <div class="t m0 x1 h6 y46 ff1 fs4 fc0 sc0 ls0 ws0">noted.</div>
                     <div class="t m0 x1 h6 y47 ff5 fs4 fc0 sc0 ls0 ws0">Future developments<span class="ff1">. For the latest information about developments </span></div>
                     <div class="t m0 x1 h6 y48 ff1 fs4 fc0 sc0 ls0 ws0">related to Form W-9 and its instructions, such as legislation enacted </div>
                     <div class="t m0 x1 h6 y49 ff1 fs4 fc0 sc0 ls0 ws0">after they were published, go to <span class="ff7">www.irs.gov/FormW9.</span></div>
                     <div class="t m0 x1 h11 y4a ff5 fs9 fc0 sc0 ls0 ws0">Purpose of Form</div>
                     <div class="t m0 x1 h6 y4b ff1 fs4 fc0 sc0 ls0 ws0">An individual or entity (Form W-9 requester) who is required to file an </div>
                     <div class="t m0 x1 h6 y4c ff1 fs4 fc0 sc0 ls0 ws0">information return with the IRS must obtain your correct taxpayer </div>
                     <div class="t m0 x1 h6 y4d ff1 fs4 fc0 sc0 ls0 ws0">identification number (TIN) which may be your social security number </div>
                     <div class="t m0 x1 h6 y4e ff1 fs4 fc0 sc0 ls0 ws0">(SSN), individual taxpayer identification number (ITIN), adoption </div>
                     <div class="t m0 x1 h6 y4f ff1 fs4 fc0 sc0 ls0 ws0">taxpayer identification number (ATIN), or employer identification number </div>
                     <div class="t m0 x1 h6 y50 ff1 fs4 fc0 sc0 ls0 ws0">(EIN), to report on an information return the amount paid to you, or other </div>
                     <div class="t m0 x1 h6 y51 ff1 fs4 fc0 sc0 ls0 ws0">amount reportable on an information return. Examples of information </div>
                     <div class="t m0 x1 h6 y52 ff1 fs4 fc0 sc0 ls0 ws0">returns include, but are not limited to, the following.</div>
                     <div class="t m0 x1 h6 y53 ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-INT (interest earned or paid)</div>
                     <div class="t m0 x20 h6 y54 ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-DIV (dividends, including those from stocks or mutual </div>
                     <div class="t m0 x20 h6 y55 ff1 fs4 fc0 sc0 ls0 ws0">funds)</div>
                     <div class="t m0 x20 h6 y56 ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-MISC (various types of income, prizes, awards, or gross </div>
                     <div class="t m0 x20 h6 y57 ff1 fs4 fc0 sc0 ls0 ws0">proceeds)</div>
                     <div class="t m0 x20 h6 y58 ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-B (stock or mutual fund sales and certain other </div>
                     <div class="t m0 x20 h6 y59 ff1 fs4 fc0 sc0 ls0 ws0">transactions by brokers)</div>
                     <div class="t m0 x20 h6 y5a ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-S (proceeds from real estate transactions)</div>
                     <div class="t m0 x20 h6 y5b ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-K (merchant card and third party network transactions)</div>
                     <div class="t m0 x20 h6 y5c ff1 fs4 fc0 sc0 ls0 ws0">• Form 1098 (home mortgage interest), 1098-E (student loan interest), </div>
                     <div class="t m0 x20 h6 y5d ff1 fs4 fc0 sc0 ls0 ws0">1098-T (tuition)</div>
                     <div class="t m0 x20 h6 y5e ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-C (canceled debt)</div>
                     <div class="t m5 x20 h6 y5f ff1 fs4 fc0 sc0 ls0 ws0">• Form 1099-A (acquisition or abandonment of secured property)</div>
                     <div class="t m0 x21 h6 y60 ff1 fs4 fc0 sc0 ls0 ws0">Use Form W-9 only if you are a U.S. person (including a resident </div>
                     <div class="t m0 x20 h6 y61 ff1 fs4 fc0 sc0 ls0 ws0">alien), to provide your correct TIN. </div>
                     <div class="t m0 x21 hf y62 ff7 fs4 fc0 sc0 ls0 ws0">If you do not return Form W-9 to the requester with a TIN, you might </div>
                     <div class="t m0 x20 h6 y63 ff7 fs4 fc0 sc0 ls0 ws0">be subject to backup withholding. See <span class="ff1">What is backup</span> <span class="ff1">withholding, </span></div>
                     <div class="t m0 x20 hf y64 ff7 fs4 fc0 sc0 ls0 ws0">later.</div>
                     <div class="t m0 x22 h3 y65 ff1 fs0 fc0 sc0 ls0 ws0">Cat. No. 10231X</div>
                     <div class="t m0 x23 he y66 ff1 fs0 fc0 sc0 ls0 ws0">Form <span class="ff5 fs8">W-9</span> (Rev. 10-2018)</div>
                  </div>
                  <div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div>
               </div>
               <div id="pf2" class="pf w0 h0" data-page-no="2">
                  <div class="pc pc2 w0 h0">
                     <img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/>
                     <div class="t m0 x1 h3 y67 ff1 fs0 fc0 sc0 ls0 ws0">Form W-9 (Rev. 10-2018)</div>
                     <div class="t m0 x24 he y68 ff1 fs0 fc0 sc0 ls0 ws0">Page <span class="ff5 fs8">2 </span></div>
                     <div class="t m0 x25 h6 y69 ff1 fs4 fc0 sc0 ls0 ws0">By signing the filled-out form, you: </div>
                     <div class="t m0 x7 h6 y6a ff1 fs4 fc0 sc0 ls0 ws0">1. Certify that the TIN you are giving is correct (or you are waiting for a </div>
                     <div class="t m0 x1 h6 y6b ff1 fs4 fc0 sc0 ls0 ws0">number to be issued),</div>
                     <div class="t m0 x7 h6 y6c ff1 fs4 fc0 sc0 ls0 ws0">2. Certify that you are not subject to backup withholding, or</div>
                     <div class="t m0 x7 h6 y6d ff1 fs4 fc0 sc0 ls0 ws0">3. Claim exemption from backup withholding if you are a U.S. exempt </div>
                     <div class="t m0 x1 h6 y6e ff1 fs4 fc0 sc0 ls0 ws0">payee. If applicable, you are also certifying that as a U.S. person, your </div>
                     <div class="t m0 x1 h6 y6f ff1 fs4 fc0 sc0 ls0 ws0">allocable share of any partnership income from a U.S. trade or business </div>
                     <div class="t m0 x1 h6 y70 ff1 fs4 fc0 sc0 ls0 ws0">is not subject to the withholding tax on foreign partners&apos; share of </div>
                     <div class="t m0 x1 h6 y71 ff1 fs4 fc0 sc0 ls0 ws0">effectively connected income, and </div>
                     <div class="t m0 x7 h6 y72 ff1 fs4 fc0 sc0 ls0 ws0">4. Certify that FATCA code(s) entered on this form (if any) indicating </div>
                     <div class="t m0 x1 h6 y73 ff1 fs4 fc0 sc0 ls0 ws0">that you are exempt from the FATCA reporting, is correct. See<span class="ff7"> What is </span></div>
                     <div class="t m0 x1 h6 y74 ff7 fs4 fc0 sc0 ls0 ws0">FATCA reporting, <span class="ff1">later, for further information.</span></div>
                     <div class="t m0 x1 h6 y75 ff5 fs4 fc0 sc0 ls0 ws0">Note: <span class="ff1">If you are a U.S. person and a requester gives you a form other </span></div>
                     <div class="t m0 x1 h6 y76 ff1 fs4 fc0 sc0 ls0 ws0">than Form W-9 to<span class="ff5"> </span>request your TIN, you must use the requester’s form if </div>
                     <div class="t m0 x1 h6 y77 ff1 fs4 fc0 sc0 ls0 ws0">it is<span class="ff5"> </span>substantially similar to this Form W-9.</div>
                     <div class="t m0 x1 h6 y78 ff5 fs4 fc0 sc0 ls0 ws0">Definition of a U.S. person. <span class="ff1">For federal tax purposes, you are</span> </div>
                     <div class="t m0 x1 h6 y79 ff1 fs4 fc0 sc0 ls0 ws0">considered a U.S. person if you are:</div>
                     <div class="t m0 x1 h6 y7a ff1 fs4 fc0 sc0 ls0 ws0">• An individual who is a U.S. citizen or U.S. resident alien;</div>
                     <div class="t m0 x1 h6 y7b ff1 fs4 fc0 sc0 ls0 ws0">• A partnership, corporation, company, or association created or </div>
                     <div class="t m0 x1 h6 y7c ff1 fs4 fc0 sc0 ls0 ws0">organized in the United States or under the laws of the United States;</div>
                     <div class="t m0 x1 h6 y7d ff1 fs4 fc0 sc0 ls0 ws0">• An estate (other than a foreign estate); or</div>
                     <div class="t m0 x1 h6 y7e ff1 fs4 fc0 sc0 ls0 ws0">• A domestic trust (as defined in Regulations section 301.7701-7).</div>
                     <div class="t m0 x1 h6 y7f ff5 fs4 fc0 sc0 ls0 ws0">Special rules for partnerships. <span class="ff1">Partnerships that conduct a</span> <span class="ff1">trade or </span></div>
                     <div class="t m0 x1 h6 y80 ff1 fs4 fc0 sc0 ls0 ws0">business in the United States are generally required to<span class="ff5"> </span>pay a withholding </div>
                     <div class="t m0 x1 h6 y81 ff1 fs4 fc0 sc0 ls0 ws0">tax under section 1446 on any foreign partners’ share of effectively </div>
                     <div class="t m0 x1 h6 y82 ff1 fs4 fc0 sc0 ls0 ws0">connected taxable income<span class="ff5"> </span>from such business. Further, in certain cases </div>
                     <div class="t m0 x1 h6 y83 ff1 fs4 fc0 sc0 ls0 ws0">where a Form W-9<span class="ff5"> </span>has not been received, the rules under section 1446 </div>
                     <div class="t m0 x1 h6 y84 ff1 fs4 fc0 sc0 ls0 ws0">require a partnership to presume that<span class="ff5"> </span>a partner is a foreign person, and </div>
                     <div class="t m0 x1 h6 y85 ff1 fs4 fc0 sc0 ls0 ws0">pay the section 1446 withholding tax.<span class="ff5"> </span>Therefore, if you are a U.S. person </div>
                     <div class="t m0 x1 h6 y86 ff1 fs4 fc0 sc0 ls0 ws0">that is a<span class="ff5"> </span>partner in a partnership conducting a trade or business in the </div>
                     <div class="t m0 x1 h6 y87 ff1 fs4 fc0 sc0 ls0 ws0">United States, provide Form W-9 to the partnership to establish your </div>
                     <div class="t m0 x1 h6 y88 ff1 fs4 fc0 sc0 ls0 ws0">U.S. status and avoid section 1446 withholding on your share of </div>
                     <div class="t m0 x1 h6 y89 ff1 fs4 fc0 sc0 ls0 ws0">partnership income.</div>
                     <div class="t m0 x7 h6 y8a ff1 fs4 fc0 sc0 ls0 ws0">In the cases below, the following person must give Form W-9 to the </div>
                     <div class="t m0 x1 h6 y8b ff1 fs4 fc0 sc0 ls0 ws0">partnership for purposes of establishing its U.S. status and avoiding </div>
                     <div class="t m0 x1 h6 y8c ff1 fs4 fc0 sc0 ls0 ws0">withholding on its allocable share of net income from the partnership </div>
                     <div class="t m0 x1 h6 y8d ff1 fs4 fc0 sc0 ls0 ws0">conducting a trade or business in the United States.</div>
                     <div class="t m0 x1 h6 y8e ff1 fs4 fc0 sc0 ls0 ws0">• In the case of a disregarded entity with a U.S. owner, the U.S. owner </div>
                     <div class="t m0 x1 h6 y8f ff1 fs4 fc0 sc0 ls0 ws0">of the disregarded entity and not the entity;</div>
                     <div class="t m0 x1 h6 y90 ff1 fs4 fc0 sc0 ls0 ws0">• In the case of a grantor trust with a U.S. grantor or other U.S. owner, </div>
                     <div class="t m0 x1 h6 y91 ff1 fs4 fc0 sc0 ls0 ws0">generally, the U.S. grantor or other U.S. owner of the grantor trust and </div>
                     <div class="t m0 x1 h6 y92 ff1 fs4 fc0 sc0 ls0 ws0">not the trust; and</div>
                     <div class="t m0 x1 h6 y93 ff1 fs4 fc0 sc0 ls0 ws0">• In the case of a U.S. trust (other than a grantor trust), the U.S. trust </div>
                     <div class="t m0 x1 h6 y94 ff1 fs4 fc0 sc0 ls0 ws0">(other than a grantor trust) and not the beneficiaries of the trust.</div>
                     <div class="t m0 x1 h6 y95 ff5 fs4 fc0 sc0 ls0 ws0">Foreign person. <span class="ff1">If you are a foreign person or the U.S. branch of a </span></div>
                     <div class="t m0 x1 h6 y96 ff1 fs4 fc0 sc0 ls0 ws0">foreign bank that has elected to be treated as a U.S. person, do not use </div>
                     <div class="t m0 x1 h6 y97 ff1 fs4 fc0 sc0 ls0 ws0">Form<span class="ff5"> </span>W-9. Instead, use the appropriate Form W-8 or Form 8233 (see </div>
                     <div class="t m0 x1 h6 y98 ff1 fs4 fc0 sc0 ls0 ws0">Pub.<span class="ff5"> </span>515, Withholding of Tax on Nonresident Aliens and Foreign<span class="ff5"> </span></div>
                     <div class="t m0 x1 h6 y99 ff1 fs4 fc0 sc0 ls0 ws0">Entities).</div>
                     <div class="t m0 x1 h6 y9a ff5 fs4 fc0 sc0 ls0 ws0">Nonresident alien who becomes a resident alien. <span class="ff1">Generally,</span> <span class="ff1">only a </span></div>
                     <div class="t m0 x1 h6 y9b ff1 fs4 fc0 sc0 ls0 ws0">nonresident alien individual may use the terms of a tax<span class="ff5"> </span>treaty to reduce </div>
                     <div class="t m0 x1 h6 y9c ff1 fs4 fc0 sc0 ls0 ws0">or eliminate U.S. tax on certain types of income.<span class="ff5"> </span>However, most tax </div>
                     <div class="t m0 x1 h6 y9d ff1 fs4 fc0 sc0 ls0 ws0">treaties contain a provision known as a<span class="ff5"> </span>“saving clause.” Exceptions </div>
                     <div class="t m0 x1 h6 y9e ff1 fs4 fc0 sc0 ls0 ws0">specified in the saving clause may<span class="ff5"> </span>permit an exemption from tax to </div>
                     <div class="t m0 x1 h6 y9f ff1 fs4 fc0 sc0 ls0 ws0">continue for certain types of<span class="ff5"> </span>income even after the payee has otherwise </div>
                     <div class="t m0 x1 h6 ya0 ff1 fs4 fc0 sc0 ls0 ws0">become a U.S.<span class="ff5"> </span>resident alien for tax purposes.</div>
                     <div class="t m0 x7 h6 ya1 ff1 fs4 fc0 sc0 ls0 ws0">If you are a U.S. resident alien who is relying on an exception </div>
                     <div class="t m0 x1 h6 ya2 ff1 fs4 fc0 sc0 ls0 ws0">contained in the saving clause of a tax treaty to claim an exemption </div>
                     <div class="t m0 x1 h6 ya3 ff1 fs4 fc0 sc0 ls0 ws0">from U.S. tax on certain types of income, you must attach a statement </div>
                     <div class="t m0 x1 h6 ya4 ff1 fs4 fc0 sc0 ls0 ws0">to Form W-9 that specifies the following five items.</div>
                     <div class="t m0 x7 h6 ya5 ff1 fs4 fc0 sc0 ls0 ws0">1. The treaty country. Generally, this must be the same treaty under </div>
                     <div class="t m0 x1 h6 ya6 ff1 fs4 fc0 sc0 ls0 ws0">which you claimed exemption from tax as a nonresident alien.</div>
                     <div class="t m0 x7 h6 ya7 ff1 fs4 fc0 sc0 ls0 ws0">2. The treaty article addressing the income.</div>
                     <div class="t m0 x7 h6 ya8 ff1 fs4 fc0 sc0 ls0 ws0">3. The article number (or location) in the tax treaty that contains the </div>
                     <div class="t m0 x1 h6 ya9 ff1 fs4 fc0 sc0 ls0 ws0">saving clause and its exceptions.</div>
                     <div class="t m0 x7 h6 yaa ff1 fs4 fc0 sc0 ls0 ws0">4. The type and amount of income that qualifies for the exemption </div>
                     <div class="t m0 x1 h6 yab ff1 fs4 fc0 sc0 ls0 ws0">from tax.</div>
                     <div class="t m0 x7 h6 yac ff1 fs4 fc0 sc0 ls0 ws0">5. Sufficient facts to justify the exemption from tax under the terms of </div>
                     <div class="t m0 x1 h6 yad ff1 fs4 fc0 sc0 ls0 ws0">the treaty article.</div>
                     <div class="t m0 x21 h6 y69 ff6 fs4 fc0 sc0 ls0 ws0">Example. <span class="ff1">Article 20 of the U.S.-China income tax treaty allows</span> <span class="ff1">an </span></div>
                     <div class="t m0 x20 h6 yae ff1 fs4 fc0 sc0 ls0 ws0">exemption from tax for scholarship income received by a<span class="ff6"> </span>Chinese </div>
                     <div class="t m0 x20 h6 yaf ff1 fs4 fc0 sc0 ls0 ws0">student temporarily present in the United States. Under<span class="ff6"> </span>U.S. law, this </div>
                     <div class="t m0 x20 h6 yb0 ff1 fs4 fc0 sc0 ls0 ws0">student will become a resident alien for tax<span class="ff6"> </span>purposes if his or her stay in </div>
                     <div class="t m0 x20 h6 yb1 ff1 fs4 fc0 sc0 ls0 ws0">the United States exceeds 5<span class="ff6"> </span>calendar years. However, paragraph 2 of </div>
                     <div class="t m0 x20 h6 y6d ff1 fs4 fc0 sc0 ls0 ws0">the first Protocol to the<span class="ff6"> </span>U.S.-China treaty (dated April 30, 1984) allows </div>
                     <div class="t m0 x20 h6 y6e ff1 fs4 fc0 sc0 ls0 ws0">the provisions of<span class="ff6"> </span>Article 20 to continue to apply even after the Chinese </div>
                     <div class="t m0 x20 h6 y6f ff1 fs4 fc0 sc0 ls0 ws0">student<span class="ff6"> </span>becomes a resident alien of the United States. A Chinese<span class="ff6"> </span></div>
                     <div class="t m0 x20 h6 y70 ff1 fs4 fc0 sc0 ls0 ws0">student who qualifies for this exception (under paragraph 2 of<span class="ff6"> </span>the first </div>
                     <div class="t m0 x20 h6 y71 ff1 fs4 fc0 sc0 ls0 ws0">protocol) and is relying on this exception to claim an<span class="ff6"> </span>exemption from tax </div>
                     <div class="t m0 x20 h6 yb2 ff1 fs4 fc0 sc0 ls0 ws0">on his or her scholarship or fellowship<span class="ff6"> </span>income would attach to Form </div>
                     <div class="t m0 x20 h6 yb3 ff1 fs4 fc0 sc0 ls0 ws0">W-9 a statement that includes the<span class="ff6"> </span>information described above to </div>
                     <div class="t m0 x20 h6 yb4 ff1 fs4 fc0 sc0 ls0 ws0">support that exemption.</div>
                     <div class="t m0 x21 h6 yb5 ff1 fs4 fc0 sc0 ls0 ws0">If you are a nonresident alien or a foreign entity, give the requester the </div>
                     <div class="t m0 x20 h6 yb6 ff1 fs4 fc0 sc0 ls0 ws0">appropriate completed Form W-8 or Form 8233.</div>
                     <div class="t m0 x20 h11 yb7 ff5 fs9 fc0 sc0 ls0 ws0">Backup Withholding</div>
                     <div class="t m0 x20 h6 yb8 ff5 fs4 fc0 sc0 ls0 ws0">What is backup withholding? <span class="ff1">Persons making certain payments</span> <span class="ff1">to you </span></div>
                     <div class="t m0 x20 h6 yb9 ff1 fs4 fc0 sc0 ls0 ws0">must under certain conditions withhold and pay to the<span class="ff5"> </span>IRS 24% of such </div>
                     <div class="t m0 x20 h6 yba ff1 fs4 fc0 sc0 ls0 ws0">payments. This is called “backup withholding.” <span class="ff5"> </span>Payments that may be </div>
                     <div class="t m0 x20 h6 ybb ff1 fs4 fc0 sc0 ls0 ws0">subject to backup withholding include<span class="ff5"> </span>interest, tax-exempt interest, </div>
                     <div class="t m0 x20 h6 ybc ff1 fs4 fc0 sc0 ls0 ws0">dividends, broker and barter<span class="ff5"> </span>exchange transactions, rents, royalties, </div>
                     <div class="t m0 x20 h6 ybd ff1 fs4 fc0 sc0 ls0 ws0">nonemployee pay, payments made in settlement of payment card and </div>
                     <div class="t m0 x20 h6 ybe ff1 fs4 fc0 sc0 ls0 ws0">third party network transactions, and<span class="ff5"> </span>certain payments from fishing boat </div>
                     <div class="t m0 x20 h6 ybf ff1 fs4 fc0 sc0 ls0 ws0">operators. Real estate<span class="ff5"> </span>transactions are not subject to backup </div>
                     <div class="t m0 x20 h6 yc0 ff1 fs4 fc0 sc0 ls0 ws0">withholding.</div>
                     <div class="t m0 x21 h6 yc1 ff1 fs4 fc0 sc0 ls0 ws0">You will not be subject to backup withholding on payments you </div>
                     <div class="t m0 x20 h6 yc2 ff1 fs4 fc0 sc0 ls0 ws0">receive if you give the requester your correct TIN, make the proper </div>
                     <div class="t m0 x20 h6 yc3 ff1 fs4 fc0 sc0 ls0 ws0">certifications, and report all your taxable interest and dividends on your </div>
                     <div class="t m0 x20 h6 yc4 ff1 fs4 fc0 sc0 ls0 ws0">tax return.</div>
                     <div class="t m0 x20 hf yc5 ff5 fs4 fc0 sc0 ls0 ws0">Payments you receive will be subject to backup withholding if: </div>
                     <div class="t m0 x21 h6 yc6 ff1 fs4 fc0 sc0 ls0 ws0">1. You do not furnish your TIN to the requester,</div>
                     <div class="t m0 x21 h6 yc7 ff1 fs4 fc0 sc0 ls0 ws0">2. You do not certify your TIN when required (see the instructions for </div>
                     <div class="t m0 x20 h6 yc8 ff1 fs4 fc0 sc0 ls0 ws0">Part II for details),</div>
                     <div class="t m0 x21 h6 yc9 ff1 fs4 fc0 sc0 ls0 ws0">3. The IRS tells the requester that you furnished an incorrect TIN,</div>
                     <div class="t m0 x21 h6 yca ff1 fs4 fc0 sc0 ls0 ws0">4. The IRS tells you that you are subject to backup withholding </div>
                     <div class="t m0 x20 h6 ycb ff1 fs4 fc0 sc0 ls0 ws0">because you did not report all your interest and dividends on your tax </div>
                     <div class="t m0 x20 h6 ycc ff1 fs4 fc0 sc0 ls0 ws0">return (for reportable interest and dividends only), or</div>
                     <div class="t m0 x21 h6 ycd ff1 fs4 fc0 sc0 ls0 ws0">5. You do not certify to the requester that you are not subject to </div>
                     <div class="t m0 x20 h6 yce ff1 fs4 fc0 sc0 ls0 ws0">backup withholding under 4 above (for reportable interest and dividend </div>
                     <div class="t m0 x20 h6 ycf ff1 fs4 fc0 sc0 ls0 ws0">accounts opened after 1983 only).</div>
                     <div class="t m0 x21 h6 yd0 ff1 fs4 fc0 sc0 ls0 ws0">Certain payees and payments are exempt from backup withholding. </div>
                     <div class="t m0 x20 h6 yd1 ff1 fs4 fc0 sc0 ls0 ws0">See <span class="ff7">Exempt payee code, </span>later, and the separate Instructions for the </div>
                     <div class="t m0 x20 h6 yd2 ff1 fs4 fc0 sc0 ls0 ws0">Requester of Form W-9 for more information.</div>
                     <div class="t m0 x21 h6 yd3 ff1 fs4 fc0 sc0 ls0 ws0">Also see <span class="ff7">Special rules for partnerships, </span>earlier.</div>
                     <div class="t m0 x20 h11 yd4 ff5 fs9 fc0 sc0 ls0 ws0">What is FATCA Reporting?</div>
                     <div class="t m0 x20 h6 yd5 ff1 fs4 fc0 sc0 ls0 ws0">The Foreign Account Tax Compliance Act (FATCA) requires a </div>
                     <div class="t m0 x20 h6 yd6 ff1 fs4 fc0 sc0 ls0 ws0">participating foreign financial institution to report all United States </div>
                     <div class="t m0 x20 h6 yd7 ff1 fs4 fc0 sc0 ls0 ws0">account holders that are specified United States persons. Certain </div>
                     <div class="t m0 x20 h6 yd8 ff1 fs4 fc0 sc0 ls0 ws0">payees are exempt from FATCA reporting. See <span class="ff7">Exemption from FATCA </span></div>
                     <div class="t m0 x20 h6 yd9 ff7 fs4 fc0 sc0 ls0 ws0">reporting code, <span class="ff1">later, and the Instructions for the Requester of Form </span></div>
                     <div class="t m0 x20 h6 yda ff1 fs4 fc0 sc0 ls0 ws0">W-9 for more information.</div>
                     <div class="t m0 x20 h11 ydb ff5 fs9 fc0 sc0 ls0 ws0">Updating Your Information</div>
                     <div class="t m0 x20 h6 y9f ff1 fs4 fc0 sc0 ls0 ws0">You must provide updated information to any person to whom you </div>
                     <div class="t m0 x20 h6 ya0 ff1 fs4 fc0 sc0 ls0 ws0">claimed to be an exempt payee if you are no longer an exempt payee </div>
                     <div class="t m0 x20 h6 ydc ff1 fs4 fc0 sc0 ls0 ws0">and anticipate receiving reportable payments in the future from this </div>
                     <div class="t m0 x20 h6 ydd ff1 fs4 fc0 sc0 ls0 ws0">person. For example, you may need to provide updated information if </div>
                     <div class="t m0 x20 h6 yde ff1 fs4 fc0 sc0 ls0 ws0">you are a C corporation that elects to be an S corporation, or if you no </div>
                     <div class="t m0 x20 h6 ya4 ff1 fs4 fc0 sc0 ls0 ws0">longer are tax exempt. In addition, you must furnish a new Form W-9 if </div>
                     <div class="t m0 x20 h6 ydf ff1 fs4 fc0 sc0 ls0 ws0">the name or TIN changes for the account; for example, if the grantor of a </div>
                     <div class="t m0 x20 h6 ye0 ff1 fs4 fc0 sc0 ls0 ws0">grantor trust dies.</div>
                     <div class="t m0 x20 h11 ye1 ff5 fs9 fc0 sc0 ls0 ws0">Penalties</div>
                     <div class="t m0 x20 h6 ya9 ff5 fs4 fc0 sc0 ls0 ws0">Failure to furnish TIN. <span class="ff1">If you fail to furnish your correct TIN to a</span> </div>
                     <div class="t m0 x20 h6 ye2 ff1 fs4 fc0 sc0 ls0 ws0">requester, you are subject to a penalty of $50 for each such<span class="ff5"> </span>failure </div>
                     <div class="t m0 x20 h6 ye3 ff1 fs4 fc0 sc0 ls0 ws0">unless your failure is due to reasonable cause and not to<span class="ff5"> </span>willful neglect.</div>
                     <div class="t m0 x20 h6 yac ff5 fs4 fc0 sc0 ls0 ws0">Civil penalty for false information with respect to withholding. <span class="ff1">If you </span></div>
                     <div class="t m0 x20 h6 ye4 ff1 fs4 fc0 sc0 ls0 ws0">make a false statement with no reasonable<span class="ff5"> </span>basis that results in no </div>
                     <div class="t m0 x20 h6 ye5 ff1 fs4 fc0 sc0 ls0 ws0">backup withholding, you are subject to a<span class="ff5"> </span>$500 penalty.</div>
                  </div>
                  <div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div>
               </div>
               <div id="pf3" class="pf w0 h0" data-page-no="3">
                  <div class="pc pc3 w0 h0">
                     <img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/>
                     <div class="t m0 x1 h3 y67 ff1 fs0 fc0 sc0 ls0 ws0">Form W-9 (Rev. 10-2018)</div>
                     <div class="t m0 x24 he y68 ff1 fs0 fc0 sc0 ls0 ws0">Page <span class="ff5 fs8">3 </span></div>
                     <div class="t m0 x1 h6 y69 ff5 fs4 fc0 sc0 ls0 ws0">Criminal penalty for falsifying information. <span class="ff1">Willfully falsifying</span> </div>
                     <div class="t m0 x1 h6 yae ff1 fs4 fc0 sc0 ls0 ws0">certifications or affirmations may subject you to criminal<span class="ff5"> </span>penalties </div>
                     <div class="t m0 x1 h6 yaf ff1 fs4 fc0 sc0 ls0 ws0">including fines and/or imprisonment.</div>
                     <div class="t m0 x1 h6 ye6 ff5 fs4 fc0 sc0 ls0 ws0">Misuse of TINs. <span class="ff1">If the requester discloses or uses TINs in</span> <span class="ff1">violation of </span></div>
                     <div class="t m0 x1 h6 ye7 ff1 fs4 fc0 sc0 ls0 ws0">federal law, the requester may be subject to civil and<span class="ff5"> </span>criminal penalties.</div>
                     <div class="t m0 x1 h10 ye8 ff5 fs2 fc0 sc0 ls0 ws0">Specific Instructions</div>
                     <div class="t m0 x1 he ye9 ff5 fs8 fc0 sc0 ls0 ws0">Line 1</div>
                     <div class="t m0 x1 h6 yb2 ff1 fs4 fc0 sc0 ls0 ws0">You must enter one of the following on this line; <span class="ff5">do not</span> leave this line </div>
                     <div class="t m0 x1 h6 yb3 ff1 fs4 fc0 sc0 ls0 ws0">blank.<span class="ff7"> </span>The name should match the name on your tax return.</div>
                     <div class="t m0 x7 h6 y74 ff1 fs4 fc0 sc0 ls0 ws0">If this Form W-9 is for a joint account (other than an account </div>
                     <div class="t m0 x1 h6 yb5 ff1 fs4 fc0 sc0 ls0 ws0">maintained by a foreign financial institution (FFI)), list first, and then </div>
                     <div class="t m0 x1 h6 yb6 ff1 fs4 fc0 sc0 ls0 ws0">circle, the name of the person or entity whose number you entered in </div>
                     <div class="t m0 x1 h6 yea ff1 fs4 fc0 sc0 ls0 ws0">Part I of Form W-9. If you are providing Form W-9 to an FFI to document </div>
                     <div class="t m0 x1 h6 yeb ff1 fs4 fc0 sc0 ls0 ws0">a joint account, each holder of the account that is a U.S. person must </div>
                     <div class="t m0 x1 h6 yec ff1 fs4 fc0 sc0 ls0 ws0">provide a Form W-9.</div>
                     <div class="t m0 x7 h6 yed ff1 fs4 fc0 sc0 ls0 ws0">a.<span class="ff5">  Individual. </span>Generally, enter the name shown on your tax return. If </div>
                     <div class="t m0 x1 h6 yee ff1 fs4 fc0 sc0 ls0 ws0">you have changed your last name without informing the Social Security </div>
                     <div class="t m0 x1 h6 y7b ff1 fs4 fc0 sc0 ls0 ws0">Administration (SSA) of the name change, enter your first name, the last </div>
                     <div class="t m0 x1 h6 y7c ff1 fs4 fc0 sc0 ls0 ws0">name as shown on your social security card, and your new last name.  </div>
                     <div class="t m0 x1 h6 y7d ff5 fs4 fc0 sc0 ls0 ws0">Note: ITIN applicant: <span class="ff1">Enter your individual name as it was entered on </span></div>
                     <div class="t m0 x1 h6 yef ff1 fs4 fc0 sc0 ls0 ws0">your Form W-7 application, line 1a. This should also be the same as the </div>
                     <div class="t m0 x1 h6 yf0 ff1 fs4 fc0 sc0 ls0 ws0">name you entered on the Form 1040/1040A/1040EZ you filed with your </div>
                     <div class="t m0 x1 h6 yf1 ff1 fs4 fc0 sc0 ls0 ws0">application.</div>
                     <div class="t m0 x7 h6 yf2 ff1 fs4 fc0 sc0 ls0 ws0">b.<span class="ff5">  Sole proprietor or single-member LLC. </span>Enter your individual </div>
                     <div class="t m0 x1 h6 yf3 ff1 fs4 fc0 sc0 ls0 ws0">name as shown on your<span class="ff5"> </span>1040/1040A/1040EZ on line 1. You may enter </div>
                     <div class="t m0 x1 h6 yf4 ff1 fs4 fc0 sc0 ls0 ws0 int2">your<span class="ff5"> </span>business, trade, or “doing business as” (DBA) name on line 2.</div>
                     <div class="t m0 x7 h6 y84 ff1 fs4 fc0 sc0 ls0 ws0">c.<span class="ff5">  Partnership, LLC that is not a single-member LLC, C </span></div>
                     <div class="t m0 x1 h6 y85 ff5 fs4 fc0 sc0 ls0 ws0">corporation, or S corporation.<span class="ff1"> Enter the entity&apos;s name as shown on the </span></div>
                     <div class="t m0 x1 h6 y86 ff1 fs4 fc0 sc0 ls0 ws0">entity&apos;s tax return on line 1 and any business, trade, or DBA name on </div>
                     <div class="t m0 x1 h6 y87 ff1 fs4 fc0 sc0 ls0 ws0">line 2.</div>
                     <div class="t m5 x7 h6 yf5 ff1 fs4 fc0 sc0 ls0 ws0">d. <span class="ff5"> Other entities. </span>Enter your name as shown on required U.S. federal </div>
                     <div class="t m5 x1 h6 yf6 ff1 fs4 fc0 sc0 ls0 ws0">tax documents on line 1. This name should match the name shown on the </div>
                     <div class="t m5 x1 h6 y8a ff1 fs4 fc0 sc0 ls0 ws0">charter or other legal document creating the entity. You may enter any </div>
                     <div class="t m5 x1 h6 y8b ff1 fs4 fc0 sc0 ls0 ws0">business, trade, or DBA name on line 2.</div>
                     <div class="t m0 x7 h6 yf7 ff1 fs4 fc0 sc0 ls0 ws0">e.<span class="ff5">  Disregarded entity. </span>For U.S. federal tax purposes, an entity that is </div>
                     <div class="t m0 x1 h6 yf8 ff1 fs4 fc0 sc0 ls0 ws0">disregarded as an entity separate from its owner is treated as a </div>
                     <div class="t m0 x1 h6 y8e ff1 fs4 fc0 sc0 ls0 ws0">“disregarded entity.”  See Regulations section 301.7701-2(c)(2)(iii). Enter </div>
                     <div class="t m0 x1 h6 y8f ff1 fs4 fc0 sc0 ls0 ws0">the owner&apos;s name on line 1. The name of the entity entered on line 1 </div>
                     <div class="t m0 x1 h6 yf9 ff1 fs4 fc0 sc0 ls0 ws0">should never be a disregarded entity. The name on line 1 should be the </div>
                     <div class="t m0 x1 h6 yfa ff1 fs4 fc0 sc0 ls0 ws0">name shown on the income tax return on which the income should be </div>
                     <div class="t m0 x1 h6 yfb ff1 fs4 fc0 sc0 ls0 ws0">reported. For example, if a foreign LLC that is treated as a disregarded </div>
                     <div class="t m0 x1 h6 yfc ff1 fs4 fc0 sc0 ls0 ws0">entity for U.S. federal tax purposes has a single owner that is a U.S. </div>
                     <div class="t m0 x1 h6 yfd ff1 fs4 fc0 sc0 ls0 ws0">person, the U.S. owner&apos;s name is required to be provided on line 1. If </div>
                     <div class="t m0 x1 h6 yfe ff1 fs4 fc0 sc0 ls0 ws0">the direct owner of the entity is also a disregarded entity, enter the first </div>
                     <div class="t m0 x1 h6 y95 ff1 fs4 fc0 sc0 ls0 ws0">owner that is not disregarded for federal tax purposes. Enter the </div>
                     <div class="t m0 x1 h6 y96 ff1 fs4 fc0 sc0 ls0 ws0">disregarded entity&apos;s name on line 2, “Business name/disregarded entity </div>
                     <div class="t m0 x1 h6 y97 ff1 fs4 fc0 sc0 ls0 ws0">name.” If the owner of the disregarded entity is a foreign person, the </div>
                     <div class="t m0 x1 h6 y98 ff1 fs4 fc0 sc0 ls0 ws0">owner must complete an appropriate Form W-8 instead of a Form W-9.  </div>
                     <div class="t m0 x1 h6 y99 ff1 fs4 fc0 sc0 ls0 ws0">This is the case even if the foreign person has a U.S. TIN. </div>
                     <div class="t m0 x1 he yff ff5 fs8 fc0 sc0 ls0 ws0">Line 2</div>
                     <div class="t m0 x1 h6 y100 ff1 fs4 fc0 sc0 ls0 ws0">If you have a business name, trade name, DBA name, or disregarded </div>
                     <div class="t m0 x1 h6 y101 ff1 fs4 fc0 sc0 ls0 ws0">entity name, you may enter it on line 2.</div>
                     <div class="t m0 x1 he y102 ff5 fs8 fc0 sc0 ls0 ws0">Line 3</div>
                     <div class="t m0 x1 h6 y103 ff1 fs4 fc0 sc0 ls0 ws0">Check the appropriate box on line 3 for the U.S. federal tax </div>
                     <div class="t m0 x1 h6 y104 ff1 fs4 fc0 sc0 ls0 ws0">classification of the person whose name is entered on line 1. Check only </div>
                     <div class="t m0 x1 h6 y105 ff1 fs4 fc0 sc0 ls0 ws0">one box on line 3.</div>
                     <div class="t m0 x26 hf y106 ff5 fs4 fc0 sc0 ls0 ws0">IF the entity/person on line 1 is </div>
                     <div class="t m0 x26 hf y6a ff5 fs4 fc0 sc0 ls0 ws0">a(n) . . .</div>
                     <div class="t m0 x27 hf y106 ff5 fs4 fc0 sc0 ls0 ws0">THEN check the box for . . .</div>
                     <div class="t m0 x28 h6 y107 ff1 fs4 fc0 sc0 ls0 ws0">•  Corporation<span class="_ _6"> </span>Corporation</div>
                     <div class="t m0 x28 h6 ye7 ff1 fs4 fc0 sc0 ls0 ws0">•  Individual </div>
                     <div class="t m0 x28 h6 y108 ff1 fs4 fc0 sc0 ls0 ws0">•  Sole proprietorship, or </div>
                     <div class="t m0 x28 h6 y109 ff1 fs4 fc0 sc0 ls0 ws0">•  Single-member limited liability </div>
                     <div class="t m0 x28 h6 y10a ff1 fs4 fc0 sc0 ls0 ws0">company (LLC) owned by an </div>
                     <div class="t m0 x28 h6 y10b ff1 fs4 fc0 sc0 ls0 ws0">individual and disregarded for U.S. </div>
                     <div class="t m0 x28 h6 y10c ff1 fs4 fc0 sc0 ls0 ws0">federal tax purposes.</div>
                     <div class="t m0 x27 h6 y10d ff1 fs4 fc0 sc0 ls0 ws0">Individual/sole proprietor or single-</div>
                     <div class="t m0 x27 h6 y10e ff1 fs4 fc0 sc0 ls0 ws0">member LLC</div>
                     <div class="t m0 x28 h6 y10f ff1 fs4 fc0 sc0 ls0 ws0">•  LLC treated as a partnership for </div>
                     <div class="t m0 x28 h6 y110 ff1 fs4 fc0 sc0 ls0 ws0">U.S. federal tax purposes, </div>
                     <div class="t m0 x28 h6 y111 ff1 fs4 fc0 sc0 ls0 ws0">•  LLC that has filed Form 8832 or </div>
                     <div class="t m0 x28 h6 y112 ff1 fs4 fc0 sc0 ls0 ws0">2553 to be taxed as a corporation, </div>
                     <div class="t m0 x28 h6 y113 ff1 fs4 fc0 sc0 ls0 ws0">or </div>
                     <div class="t m0 x28 h6 y114 ff1 fs4 fc0 sc0 ls0 ws0">•  LLC that is disregarded as an </div>
                     <div class="t m0 x28 h6 y115 ff1 fs4 fc0 sc0 ls0 ws0">entity separate from its owner but </div>
                     <div class="t m0 x28 h6 y116 ff1 fs4 fc0 sc0 ls0 ws0">the owner is another LLC that is </div>
                     <div class="t m0 x28 h6 y117 ff1 fs4 fc0 sc0 ls0 ws0">not disregarded for U.S. federal tax </div>
                     <div class="t m0 x28 h6 y118 ff1 fs4 fc0 sc0 ls0 ws0">purposes.</div>
                     <div class="t m0 x27 h6 y119 ff1 fs4 fc0 sc0 ls0 ws0">Limited liability company and enter </div>
                     <div class="t m0 x27 h6 y11a ff1 fs4 fc0 sc0 ls0 ws0">the appropriate tax classification. </div>
                     <div class="t m0 x27 h6 y11b ff1 fs4 fc0 sc0 ls0 ws0">(P= Partnership; C= C corporation; </div>
                     <div class="t m0 x27 h6 y11c ff1 fs4 fc0 sc0 ls0 ws0">or S= S corporation)</div>
                     <div class="t m0 x28 h6 y11d ff1 fs4 fc0 sc0 ls0 ws0">•  Partnership<span class="_ _7"> </span>Partnership</div>
                     <div class="t m0 x28 h6 y11e ff1 fs4 fc0 sc0 ls0 ws0">•  Trust/estate<span class="_ _6"> </span>Trust/estate</div>
                     <div class="t m0 x20 he y11f ff5 fs8 fc0 sc0 ls0 ws0">Line 4, Exemptions</div>
                     <div class="t m0 x20 h6 y120 ff1 fs4 fc0 sc0 ls0 ws0">If you are exempt from backup withholding and/or FATCA reporting, </div>
                     <div class="t m0 x20 h6 y121 ff1 fs4 fc0 sc0 ls0 ws0">enter in the appropriate space on line 4 any code(s) that may apply to </div>
                     <div class="t m0 x20 h6 y122 ff1 fs4 fc0 sc0 ls0 ws0">you.</div>
                     <div class="t m0 x20 hf y123 ff5 fs4 fc0 sc0 ls0 ws0">Exempt payee code.</div>
                     <div class="t m0 x20 h6 y85 ff1 fs4 fc0 sc0 ls0 ws0">•  Generally, individuals (including sole proprietors) are not exempt from </div>
                     <div class="t m0 x20 h6 y86 ff1 fs4 fc0 sc0 ls0 ws0">backup withholding.</div>
                     <div class="t m0 x20 h6 y124 ff1 fs4 fc0 sc0 ls0 ws0">•  Except as provided below, corporations are exempt from backup </div>
                     <div class="t m0 x20 h6 yf5 ff1 fs4 fc0 sc0 ls0 ws0">withholding for certain payments, including interest and dividends.</div>
                     <div class="t m0 x20 h6 y125 ff1 fs4 fc0 sc0 ls0 ws0">•  Corporations are not exempt from backup withholding for payments </div>
                     <div class="t m0 x20 h6 y126 ff1 fs4 fc0 sc0 ls0 ws0">made in settlement of payment card or third party network transactions.</div>
                     <div class="t m0 x20 h6 y127 ff1 fs4 fc0 sc0 ls0 ws0">•  Corporations are not exempt from backup withholding with respect to </div>
                     <div class="t m0 x20 h6 y128 ff1 fs4 fc0 sc0 ls0 ws0">attorneys’ fees or gross proceeds paid to attorneys, and corporations </div>
                     <div class="t m0 x20 h6 y129 ff1 fs4 fc0 sc0 ls0 ws0">that provide medical or health care services are not exempt with respect </div>
                     <div class="t m0 x20 h6 y12a ff1 fs4 fc0 sc0 ls0 ws0">to payments reportable on Form 1099-MISC.</div>
                     <div class="t m0 x21 h6 y12b ff1 fs4 fc0 sc0 ls0 ws0">The following codes identify payees that are exempt from backup </div>
                     <div class="t m0 x20 h6 y12c ff1 fs4 fc0 sc0 ls0 ws0">withholding. Enter the appropriate code in the space in line 4.</div>
                     <div class="t m0 x29 h6 yfb ff1 fs4 fc0 sc0 ls0 ws0">1—An organization exempt from tax under section 501(a), any IRA, or </div>
                     <div class="t m0 x20 h6 yfc ff1 fs4 fc0 sc0 ls0 ws0">a custodial account under section 403(b)(7) if the account satisfies the </div>
                     <div class="t m0 x20 h6 yfd ff1 fs4 fc0 sc0 ls0 ws0">requirements of section 401(f)(2)</div>
                     <div class="t m0 x29 h6 y12d ff1 fs4 fc0 sc0 ls0 ws0">2—The United States or any of its agencies or instrumentalities</div>
                     <div class="t m0 x29 h6 y12e ff1 fs4 fc0 sc0 ls0 ws0">3—A state, the District of Columbia, a U.S. commonwealth or </div>
                     <div class="t m0 x20 h6 y12f ff1 fs4 fc0 sc0 ls0 ws0">possession, or any of their political subdivisions or instrumentalities</div>
                     <div class="t m0 x29 h6 y98 ff1 fs4 fc0 sc0 ls0 ws0">4—A foreign government or any of its political subdivisions, agencies, </div>
                     <div class="t m0 x20 h6 y99 ff1 fs4 fc0 sc0 ls0 ws0">or instrumentalities </div>
                     <div class="t m0 x29 h6 y9a ff1 fs4 fc0 sc0 ls0 ws0">5—A corporation</div>
                     <div class="t m0 x29 h6 y130 ff1 fs4 fc0 sc0 ls0 ws0">6—A dealer in securities or commodities required to register in the </div>
                     <div class="t m0 x20 h6 y131 ff1 fs4 fc0 sc0 ls0 ws0">United States, the District of Columbia, or a U.S. commonwealth or </div>
                     <div class="t m0 x20 h6 y132 ff1 fs4 fc0 sc0 ls0 ws0">possession </div>
                     <div class="t m0 x29 h6 y133 ff1 fs4 fc0 sc0 ls0 ws0">7—A futures commission merchant registered with the Commodity </div>
                     <div class="t m0 x20 h6 y134 ff1 fs4 fc0 sc0 ls0 ws0">Futures Trading Commission</div>
                     <div class="t m0 x29 h6 ydc ff1 fs4 fc0 sc0 ls0 ws0">8—A real estate investment trust</div>
                     <div class="t m0 x29 h6 y135 ff1 fs4 fc0 sc0 ls0 ws0">9—An entity registered at all times during the tax year under the </div>
                     <div class="t m0 x20 h6 y136 ff1 fs4 fc0 sc0 ls0 ws0">Investment Company Act of 1940</div>
                     <div class="t m0 x20 h6 y137 ff1 fs4 fc0 sc0 ls0 ws0">10—A common trust fund operated by a bank under section 584(a)</div>
                     <div class="t m0 x20 h6 ye0 ff1 fs4 fc0 sc0 ls0 ws0">11—A financial institution</div>
                     <div class="t m0 x20 h6 ya7 ff1 fs4 fc0 sc0 ls0 ws0">12—A middleman known in the investment community as a nominee or </div>
                     <div class="t m0 x20 h6 y138 ff1 fs4 fc0 sc0 ls0 ws0">custodian</div>
                     <div class="t m0 x20 h6 y139 ff1 fs4 fc0 sc0 ls0 ws0">13—A trust exempt from tax under section 664 or described in section </div>
                     <div class="t m0 x20 h6 yaa ff1 fs4 fc0 sc0 ls0 ws0">4947</div>
