                     <div class="t m0 x1 h3 y67 ff1 fs0 fc0 sc0 ls0 ws0">Form W-9 (Rev. 10-2018)</div>
                     <div class="t m0 x24 he y68 ff1 fs0 fc0 sc0 ls0 ws0">Page <span class="ff5 fs8">4 </span></div>
                     <div class="t m0 x7 h6 y69 ff1 fs4 fc0 sc0 ls0 ws0">The following chart shows types of payments that may be exempt </div>
                     <div class="t m0 x1 h6 yae ff1 fs4 fc0 sc0 ls0 ws0">from backup withholding. The chart applies to the exempt payees listed </div>
