                     <div class="t m0 x20 h6 y1fd ff1 fs4 fc0 sc0 ls0 ws0">name line. You may use either your SSN or EIN (if you have one), but the </div>
                     <div class="t m0 x20 h6 y1fe ff1 fs4 fc0 sc0 ls0 ws0">IRS encourages you to use your SSN.</div>
