                     <div class="t m0 x20 h6 y203 ff7 fs4 fc0 sc0 ls0 ws0">rules for partnerships,<span class="ff1"> earlier.</span></div>
                     <div class="t m0 x20 h6 y204 ff5 fs4 fc0 sc0 ls0 ws0">*Note:<span class="ff1"> The grantor also must provide a Form W-9 to trustee of trust.</span></div>
                     <div class="t m0 x20 h6 y205 ff5 fs4 fc0 sc0 ls0 ws0">Note: <span class="ff1">If no name is circled when more than one name is listed,</span> <span class="ff1">the </span></div>
                     <div class="t m0 x20 h6 y206 ff1 fs4 fc0 sc0 ls0 ws0">number will be considered to be that of the first name listed.</div>
                     <div class="t m5 x20 h11 y207 ff5 fs9 fc0 sc0 ls0 ws0">Secure Your Tax Records From Identity Theft</div>
                     <div class="t m0 x20 h6 y208 ff1 fs4 fc0 sc0 ls0 ws0">Identity theft occurs when someone uses your personal information </div>
                     <div class="t m0 x20 h6 y209 ff1 fs4 fc0 sc0 ls0 ws0">such as your name, SSN, or other identifying information, without your </div>
                     <div class="t m0 x20 h6 y20a ff1 fs4 fc0 sc0 ls0 ws0">permission, to commit fraud or other crimes. An identity thief may use </div>
                     <div class="t m0 x20 h6 y20b ff1 fs4 fc0 sc0 ls0 ws0">your SSN to get a job or may file a tax return using your SSN to receive </div>
                     <div class="t m0 x20 h6 y20c ff1 fs4 fc0 sc0 ls0 ws0">a refund.</div>
                     <div class="t m0 x21 h6 y20d ff1 fs4 fc0 sc0 ls0 ws0">To reduce your risk:</div>
                     <div class="t m0 x20 h6 y20e ff1 fs4 fc0 sc0 ls0 ws0">• Protect your SSN,</div>
                     <div class="t m0 x20 h6 y20f ff1 fs4 fc0 sc0 ls0 ws0">• Ensure your employer is protecting your SSN, and</div>
                     <div class="t m0 x20 h6 y210 ff1 fs4 fc0 sc0 ls0 ws0">• Be careful when choosing a tax preparer.</div>
                     <div class="t m0 x21 h6 y211 ff1 fs4 fc0 sc0 ls0 ws0">If your tax records are affected by identity theft and you receive a </div>
                     <div class="t m0 x20 h6 y212 ff1 fs4 fc0 sc0 ls0 ws0">notice from the IRS, respond right away to the name and phone number </div>
                     <div class="t m0 x20 h6 y213 ff1 fs4 fc0 sc0 ls0 ws0">printed on the IRS notice or letter.</div>
                     <div class="t m0 x21 h6 y214 ff1 fs4 fc0 sc0 ls0 ws0">If your tax records are not currently affected by identity theft but you </div>
                     <div class="t m0 x20 h6 y215 ff1 fs4 fc0 sc0 ls0 ws0">think you are at risk due to a lost or stolen purse or wallet, questionable </div>
                     <div class="t m0 x20 h6 y216 ff1 fs4 fc0 sc0 ls0 ws0">credit card activity or credit report, contact the IRS Identity Theft Hotline </div>
                     <div class="t m0 x20 h6 y217 ff1 fs4 fc0 sc0 ls0 ws0">at 1-800-908-4490 or submit Form 14039.</div>
                     <div class="t m0 x21 h6 y218 ff1 fs4 fc0 sc0 ls0 ws0">For more information, see Pub. 5027, Identity Theft Information for </div>
                     <div class="t m0 x20 h6 y219 ff1 fs4 fc0 sc0 ls0 ws0">Taxpayers.</div>
                     <div class="t m0 x21 h6 y21a ff1 fs4 fc0 sc0 ls0 ws0">Victims of identity theft who are experiencing economic harm or a </div>
                     <div class="t m0 x20 h6 y21b ff1 fs4 fc0 sc0 ls0 ws0">systemic problem, or are seeking help in resolving tax problems that </div>
                     <div class="t m0 x20 h6 y21c ff1 fs4 fc0 sc0 ls0 ws0">have not been resolved through normal channels, may be eligible for </div>
                     <div class="t m0 x20 h6 y21d ff1 fs4 fc0 sc0 ls0 ws0">Taxpayer Advocate Service (TAS) assistance. You can reach TAS by </div>
                     <div class="t m0 x20 h6 y21e ff1 fs4 fc0 sc0 ls0 ws0">calling the TAS toll-free case intake line at 1-877-777-4778 or TTY/TDD </div>
                     <div class="t m0 x20 h6 y21f ff1 fs4 fc0 sc0 ls0 ws0">1-800-829-4059.</div>
                     <div class="t m0 x20 hf y220 ff5 fs4 fc0 sc0 ls0 ws0">Protect yourself from suspicious emails or phishing schemes.  </div>
                     <div class="t m0 x20 h6 y221 ff1 fs4 fc0 sc0 ls0 ws0">Phishing is the creation and use of email and<span class="ff5"> </span>websites designed to </div>
                     <div class="t m0 x20 h6 y222 ff1 fs4 fc0 sc0 ls0 ws0">mimic legitimate business emails and<span class="ff5"> </span>websites. The most common act </div>
                     <div class="t m0 x20 h6 y223 ff1 fs4 fc0 sc0 ls0 ws0">is sending an email to a user<span class="ff5"> </span>falsely claiming to be an established </div>
                     <div class="t m0 x20 h6 y224 ff1 fs4 fc0 sc0 ls0 ws0">legitimate enterprise in an<span class="ff5"> </span>attempt to scam the user into surrendering </div>
                     <div class="t m0 x20 h6 y225 ff1 fs4 fc0 sc0 ls0 ws0">private information<span class="ff5"> </span>that will be used for identity theft.</div>
                  </div>
                  <div class="pi" data-data='{"ctm":[1.500000,0.000000,0.000000,1.500000,0.000000,0.000000]}'></div>
               </div>
               <div id="pf6" class="pf w0 h0" data-page-no="6">
                  <div class="pc pc6 w0 h0">
                     <img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/>
                     <div class="t m0 x1 h3 y67 ff1 fs0 fc0 sc0 ls0 ws0">Form W-9 (Rev. 10-2018)</div>
                     <div class="t m0 x24 he y68 ff1 fs0 fc0 sc0 ls0 ws0">Page <span class="ff5 fs8">6 </span></div>
                     <div class="t m0 x1b h6 y226 ff1 fs4 fc0 sc0 ls0 ws0">The IRS does not initiate contacts with taxpayers via emails. Also, the </div>
                     <div class="t m0 x3a h6 y227 ff1 fs4 fc0 sc0 ls0 ws0">IRS does not request personal detailed information through email or ask </div>
                     <div class="t m0 x3a h6 y228 ff1 fs4 fc0 sc0 ls0 ws0">taxpayers for the PIN numbers, passwords, or similar secret access </div>
                     <div class="t m0 x3a h6 y229 ff1 fs4 fc0 sc0 ls0 ws0">information for their credit card, bank, or other financial accounts.</div>
                     <div class="t m0 x1b h6 y22a ff1 fs4 fc0 sc0 ls0 ws0">If you receive an unsolicited email claiming to be from the IRS, </div>
                     <div class="t m0 x3a h6 y22b ff1 fs4 fc0 sc0 ls0 ws0">forward this message to <span class="ff7">phishing@irs.gov. </span>You may also report misuse </div>
                     <div class="t m0 x3a h6 y22c ff1 fs4 fc0 sc0 ls0 ws0">of the IRS name, logo, or other IRS property to the Treasury Inspector </div>
                     <div class="t m0 x3a h6 y22d ff1 fs4 fc0 sc0 ls0 ws0">General for Tax Administration (TIGTA) at 1-800-366-4484. You can </div>
                     <div class="t m0 x3a h6 y22e ff1 fs4 fc0 sc0 ls0 ws0">forward suspicious emails to the Federal Trade Commission at </div>
                     <div class="t m0 x3a h6 y22f ff7 fs4 fc0 sc0 ls0 ws0">spam@uce.gov <span class="ff1">or report them at </span>www.ftc.gov/complaint. <span class="ff1">You can </span></div>
                     <div class="t m0 x3a h6 y230 ff1 fs4 fc0 sc0 ls0 ws0">contact the FTC at <span class="ff7">www.ftc.gov/idtheft </span>or 877-IDTHEFT (877-438-4338). </div>
                     <div class="t m0 x3a h6 y231 ff1 fs4 fc0 sc0 ls0 ws0">If you have been the victim of identity theft, see <span class="ff7">www.IdentityTheft.gov</span> </div>
                     <div class="t m0 x3a h6 y232 ff1 fs4 fc0 sc0 ls0 ws0">and Pub. 5027.</div>
                     <div class="t m0 x1b h6 y233 ff1 fs4 fc0 sc0 ls0 ws0">Visit <span class="ff7">www.irs.gov/IdentityTheft </span>to learn more about identity theft and </div>
                     <div class="t m0 x3a h6 y234 ff1 fs4 fc0 sc0 ls0 ws0">how to reduce your risk.</div>
                     <div class="t m0 x20 h11 y235 ff5 fs9 fc0 sc0 ls0 ws0">Privacy Act Notice</div>
                     <div class="t m0 x20 h6 y236 ff1 fs4 fc0 sc0 ls0 ws0">Section 6109 of the Internal Revenue Code requires you to provide your </div>
                     <div class="t m0 x20 h6 y237 ff1 fs4 fc0 sc0 ls0 ws0">correct TIN to persons (including federal agencies) who are required to </div>
                     <div class="t m0 x20 h6 y238 ff1 fs4 fc0 sc0 ls0 ws0">file information returns with the IRS to report interest, dividends, or </div>
                     <div class="t m0 x20 h6 y239 ff1 fs4 fc0 sc0 ls0 ws0">certain other income paid to you; mortgage interest you paid; the </div>
                     <div class="t m0 x20 h6 y23a ff1 fs4 fc0 sc0 ls0 ws0">acquisition or abandonment of secured property; the cancellation of </div>
                     <div class="t m0 x20 h6 y109 ff1 fs4 fc0 sc0 ls0 ws0">debt; or contributions you made to an IRA, Archer MSA, or HSA. The </div>
                     <div class="t m0 x20 h6 y10a ff1 fs4 fc0 sc0 ls0 ws0">person collecting this form uses the information on the form to file </div>
                     <div class="t m0 x20 h6 y10b ff1 fs4 fc0 sc0 ls0 ws0">information returns with the IRS, reporting the above information. </div>
                     <div class="t m0 x20 h6 y10c ff1 fs4 fc0 sc0 ls0 ws0">Routine uses of this information include giving it to the Department of </div>
                     <div class="t m0 x20 h6 y23b ff1 fs4 fc0 sc0 ls0 ws0">Justice for civil and criminal litigation and to cities, states, the District of </div>
                     <div class="t m0 x20 h6 y23c ff1 fs4 fc0 sc0 ls0 ws0">Columbia, and U.S. commonwealths and possessions for use in </div>
                     <div class="t m0 x20 h6 y23d ff1 fs4 fc0 sc0 ls0 ws0">administering their laws. The information also may be disclosed to other </div>
                     <div class="t m0 x20 h6 y23e ff1 fs4 fc0 sc0 ls0 ws0">countries under a treaty, to federal and state agencies to enforce civil </div>
                     <div class="t m0 x20 h6 y23f ff1 fs4 fc0 sc0 ls0 ws0">and criminal laws, or to federal law enforcement and intelligence </div>
                     <div class="t m0 x20 h6 y240 ff1 fs4 fc0 sc0 ls0 ws0">agencies to combat terrorism. You must provide your TIN whether or </div>
                     <div class="t m0 x20 h6 y241 ff1 fs4 fc0 sc0 ls0 ws0">not you are required to file a tax return. Under section 3406, payers </div>
                     <div class="t m0 x20 h6 yb8 ff1 fs4 fc0 sc0 ls0 ws0">must generally withhold a percentage of taxable interest, dividend, and </div>
                     <div class="t m0 x20 h6 yb9 ff1 fs4 fc0 sc0 ls0 ws0">certain other payments to a payee who does not give a TIN to the payer. </div>
                     <div class="t m0 x20 h6 yba ff1 fs4 fc0 sc0 ls0 ws0">Certain penalties may also apply for providing false or fraudulent </div>
                     <div class="t m0 x20 h6 ybb ff1 fs4 fc0 sc0 ls0 ws0">information.</div>
                  </div>
